export const hostdata = [
  {
    title: "Why recommend GreenHouse hosting",
    detail:
      "GreenHouse makes it easy and secure to host guests regardless of the type of listing they share. Availability, rates, house rules, and interactions with guests are entirely up to the host.",
  },
  {
    title: "Relieve",
    detail:
      "With a $1 million property damage protection program and a separate $1 million insurance against accidents, GreenHouse has comprehensive safeguards in place to protect your hosts, their homes, property, and guests.",
  },
];
